import React from 'react';
import './cart-item.styles.css';

const CartItem = ({
  imageUrl, name, price, quantity,
}) => (
  <div className="cart-item">
    <div>
      <img src={imageUrl} alt="item" />
      <span>{name}</span>
      <span>{`${quantity}x${price}`}</span>
    </div>
  </div>
);

export default CartItem;
